Había que volver a nuestra prueba favorita en la pista 💪🏽☺️los 10.000mts planos. Una carrera que jamás pensé liderar del principio hasta los 7000mts, pero como dice Steve Prefontaine “Dar cualquier cosa menor a tu capacidad, es sacrificar el don” y yo quería buscar mi mejor marca! 

Y así fue, salió mejor marca en 10.000mts planos, pero un cuarto lugar que deja un sabor amargo en mi, pero la satisfacción de haber dado lo mejor en cada vuelta! 

Me llevo el mejor recuerdo, el apoyo de mis atletas y entrenador en cada vuelta! Y el de demostrar que aún puedo dar un bonito espectáculo a nivel nacional y con grandes atletas 🤝☺️

Gracias equipo, familia y amigos por estar ahí 🫶🏽😍

